           + 2 * p[0] * p[2] * x[3]
           + 2 * p[1] * p[2] * x[4]
           + p[2] * p[2] * x[5]
           + 2 * p[0] * p[3] * x[6]
           + 2 * p[1] * p[3] * x[7]
           + 2 * p[2] * p[3] * x[8]
           + p[3] * p[3] * x[9];
